import React from 'react';
import { motion } from 'framer-motion';
import './FloatingElements.css';

const FloatingElements = () => {
  const elements = [
    { icon: 'üíù', top: '10%', left: '5%', delay: 0, size: '2rem' },
    { icon: 'üí°', top: '20%', right: '8%', delay: -2, size: '2.5rem' },
    { icon: 'ü§ù', bottom: '25%', left: '3%', delay: -4, size: '2rem' },
    { icon: 'üå±', top: '60%', right: '5%', delay: -1, size: '1.8rem' },
    { icon: '‚ö°', bottom: '15%', right: '12%', delay: -3, size: '2rem' },
    { icon: 'üë•', top: '75%', left: '8%', delay: -5, size: '2.2rem' },
    { icon: 'üìö', top: '40%', left: '2%', delay: -1.5, size: '1.8rem' },
    { icon: 'üåç', top: '85%', right: '3%', delay: -2.5, size: '2rem' },
    { icon: 'üéØ', top: '30%', right: '15%', delay: -4.5, size: '1.9rem' },
    { icon: '‚ù§Ô∏è', bottom: '45%', left: '6%', delay: -0.5, size: '2.1rem' },
    { icon: 'üè•', top: '15%', left: '15%', delay: -6, size: '2rem' },
    { icon: 'üéì', bottom: '35%', right: '20%', delay: -1.8, size: '2.2rem' },
    { icon: '‚ôªÔ∏è', top: '50%', left: '12%', delay: -3.2, size: '1.9rem' },
    { icon: 'üè†', bottom: '60%', right: '8%', delay: -2.7, size: '2.1rem' },
    { icon: 'üåü', top: '65%', left: '18%', delay: -4.8, size: '1.8rem' },
    { icon: 'üî¨', bottom: '20%', left: '20%', delay: -0.8, size: '2rem' },
    { icon: 'üé®', top: '35%', right: '25%', delay: -5.5, size: '1.9rem' },
    { icon: 'üöÄ', top: '80%', right: '18%', delay: -1.2, size: '2.1rem' },
    { icon: 'üíª', bottom: '70%', right: '15%', delay: -4.2, size: '2rem' },
  ];

  // Special floating circular element for gravnix branding
  const gravnixElement = {
    top: '5%',
    right: '5%',
    delay: 0,
    size: '1rem',
    isGravnix: true
  };

  return (
    <div className="floating-elements-container">
      {elements.map((element, index) => (
        <motion.div
          key={index}
          className="floating-element"
          style={{
            top: element.top,
            bottom: element.bottom,
            left: element.left,
            right: element.right,
            fontSize: element.size,
          }}
          animate={{
            y: [0, -30, -10, -25, 0],
            x: [0, 10, -5, 8, 0],
            rotate: [0, 8, -8, 5, -3, 0],
            scale: [1, 1.1, 0.9, 1.05, 1],
          }}
          transition={{
            duration: 8 + Math.random() * 6,
            repeat: Infinity,
            ease: "easeInOut",
            delay: element.delay,
          }}
        >
          {element.icon}
        </motion.div>
      ))}

      {/* Special gravnix branding element */}
      <motion.div
        className="floating-element gravnix-brand"
        style={{
          top: gravnixElement.top,
          right: gravnixElement.right,
          fontSize: gravnixElement.size,
        }}
        animate={{
          y: [0, -20, -5, -15, 0],
          x: [0, 5, -3, 4, 0],
          rotate: [0, 5, -5, 3, -2, 0],
          scale: [1, 1.05, 0.95, 1.02, 1],
        }}
        transition={{
          duration: 6,
          repeat: Infinity,
          ease: "easeInOut",
          delay: gravnixElement.delay,
        }}
      >
        <div className="gravnix-circle">
          <span className="gravnix-text">developed by</span>
          <span className="gravnix-website">gravnix.com</span>
        </div>
      </motion.div>
    </div>
  );
};

export default FloatingElements;
